import React , {useState,useEffect} from 'react'
import axios from 'axios'

const url = "http://localhost:5000/"




function Log() {
    const [res, setRes] = useState(" ")

    useEffect(() => {
      axios.get(url).then((response) => {
          setRes("abba");
          console.log(response.data);
          console.log(res);
      })
    }, [])
    
  return (
      <>
        <div>Log</div>
        <div>
            
        </div>
      </>
  )
}

export default Log
